-- This file is to bootstrap a database for the CS3200 project.

-- Create a new database.  You can change the name later.  You'll
-- need this name in the FLASK API file(s),  the AppSmith
-- data source creation.
create database menuette;

-- Via the Docker Compose file, a special user called webapp will
-- be created in MySQL. We are going to grant that user
-- all privilages to the new database we just created.
grant all privileges on menuette.* to 'webapp'@'%';
flush privileges;

-- Move into the database we just created.
use menuette;

CREATE TABLE User
(
    id         INT AUTO_INCREMENT NOT NULL,
    username   VARCHAR(30)        NOT NULL,
    name       VARCHAR(30)        NOT NULL,
    type       VARCHAR(30)        NOT NULL,
    profilePic VARCHAR(30),
    PRIMARY KEY (id)
);


CREATE TABLE Restaurant
(
    id          INT AUTO_INCREMENT NOT NULL,
    onExplore   boolean            NOT NULL,
    address     VARCHAR(50)        NOT NULL,
    city        VARCHAR(30)        NOT NULL,
    state       VARCHAR(20)        NOT NULL,
    zipCode     INT                NOT NULL,
    description VARCHAR(400)       NOT NULL,
    name        VARCHAR(40)        NOT NULL,
    hours       VARCHAR(20)        NOT NULL,
    PRIMARY KEY (id)
);


CREATE TABLE Menu
(
    id     INT AUTO_INCREMENT NOT NULL,
    name   VARCHAR(30)        NOT NULL,
    restId INT                NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT fk_01 FOREIGN KEY (restId)
        REFERENCES Restaurant (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Reviews
(
    id             INT AUTO_INCREMENT NOT NULL,
    restaurantResp VARCHAR(400),
    title          VARCHAR(100)        NOT NULL,
    date           DATETIME DEFAULT CURRENT_TIMESTAMP,
    byUserId       INT                NOT NULL,
    stars          INT                NOT NULL,
    CHECK ( stars <= 5 ),
    CHECK ( stars > 0 ),
    description    VARCHAR(400),
    restId         INT                NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT fk_02 FOREIGN KEY (restId)
        REFERENCES Restaurant (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_03 FOREIGN KEY (byUserId)
        REFERENCES User (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Social_Groups
(
    id   INT AUTO_INCREMENT NOT NULL,
    name VARCHAR(70)        NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE User_Groups
(
    userId  INT NOT NULL,
    groupId INT NOT NULL,
    PRIMARY KEY (userId, groupId),
    CONSTRAINT fk_user_groups FOREIGN KEY (userId)
        REFERENCES User (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_groups_user FOREIGN KEY (groupId)
        REFERENCES Social_Groups (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Menu_Items
(
    id          INT AUTO_INCREMENT NOT NULL,
    name        VARCHAR(100)        NOT NULL,
    description VARCHAR(200),
    menuId      INT                NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT fk_09 FOREIGN KEY (menuId)
        REFERENCES Menu (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Filters
(
    id   INT AUTO_INCREMENT NOT NULL,
    name VARCHAR(70)        NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE Durations
(
    duration INT NOT NULL,
    price    INT NOT NULL,
    PRIMARY KEY (duration)
);

CREATE TABLE Advertisements
(
    id             INT AUTO_INCREMENT NOT NULL,
    header         VARCHAR(200)       NOT NULL,
    targetAudience INT                NOT NULL,
    duration       INT                NOT NULL,
    description    VARCHAR(200)       NOT NULL,
    restId         INT                NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT fk_14 FOREIGN KEY (restId)
        REFERENCES Restaurant (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_dur FOREIGN KEY (duration)
        REFERENCES Durations (duration)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_target FOREIGN KEY (targetAudience)
        REFERENCES Filters (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Pictures
(
    id       INT AUTO_INCREMENT NOT NULL,
    pic      VARCHAR(30)        NOT NULL,
    reviewId INT                NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT fk_15 FOREIGN KEY (reviewId)
        REFERENCES Reviews (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);

CREATE TABLE Menu_Items_Filters
(
    menuId   INT NOT NULL,
    filterId INT NOT NULL,
    PRIMARY KEY (menuId, filterId),
    CONSTRAINT fk_05 FOREIGN KEY (menuId)
        REFERENCES Menu_Items (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_06 FOREIGN KEY (filterId)
        REFERENCES Filters (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);

CREATE TABLE User_Filter
(
    userId   INT NOT NULL,
    filterId INT NOT NULL,
    PRIMARY KEY (userId, filterId),
    CONSTRAINT fk_07 FOREIGN KEY (userId)
        REFERENCES User (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_08 FOREIGN KEY (filterId)
        REFERENCES Filters (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Rest_Reviews
(
    reviewId INT NOT NULL,
    restId   INT NOT NULL,
    PRIMARY KEY (reviewId, restId),
    CONSTRAINT fk_10 FOREIGN KEY (reviewId)
        REFERENCES Reviews (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_11 FOREIGN KEY (restId)
        REFERENCES Restaurant (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Item_Reviews
(
    itemId   INT NOT NULL,
    reviewId INT NOT NULL,
    PRIMARY KEY (itemId, reviewId),
    CONSTRAINT fk_12 FOREIGN KEY (reviewId)
        REFERENCES Reviews (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_13 FOREIGN KEY (itemId)
        REFERENCES Menu_Items (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE Group_Review
(
    reviewId INT NOT NULL,
    groupId  INT NOT NULL,
    PRIMARY KEY (reviewId, groupId),
    CONSTRAINT fk_review FOREIGN KEY (reviewId)
        REFERENCES Reviews (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_group FOREIGN KEY (groupId)
        REFERENCES Social_Groups (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);


CREATE TABLE User_Review
(
    reviewId INT NOT NULL,
    userId   INT NOT NULL,
    PRIMARY KEY (reviewId, userId),
    CONSTRAINT fk_review_user FOREIGN KEY (reviewId)
        REFERENCES Reviews (id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    CONSTRAINT fk_user_review FOREIGN KEY (userId)
        REFERENCES User (id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);




















